nding, outdoors and text that says 'LACOSTE'.","edge_media_to_caption":{"edges":[{"node":{"text":"\u041f\u0440\u0438\u0432\u0435\u0442 \u0432\u0441\u0435\u043c! \n\n\u041a \u0441\u043e\u0436\u0430\u043b\u0435\u043d\u0438\u044e \u0432 \u044d\u0442\u043e\u043c \u0433\u043e\u0434\u0443 \u044f \u043d\u0435 \u0441\u043c\u043e\u0433\u0443 \u0432\u044b\u0441\u0442\u0443\u043f\u0438\u0442\u044c \u043d\u0430 \u041a\u0443\u0431\u043a\u0435 \u041a\u0440\u0435\u043c\u043b\u044f. \n\u0422\u0443\u0440\u043d\u0438\u0440 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 - \u044d\u0442\u043e \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u0430\u044f \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u0441\u044b\u0433\u0440\u0430\u0442\u044c \u0434\u043e\u043c\u0430 \u043f\u0440\u0438 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u0431\u043e\u043b\u0435\u043b\u044c\u0449\u0438\u043a\u0430\u0445. \u042f \u0437\u0430\u044f\u0432\u0438\u043b\u0441\u044f \u043d\u0430 \u0442\u0443\u0440\u043d\u0438\u0440 \u0438 \u043d\u0430\u0434\u0435\u044f\u043b\u0441\u044f \u0435\u0433\u043e \u0441\u044b\u0433\u0440\u0430\u0442\u044c, \u043d\u043e \u0438\u0437-\u0437\u0430 \u0441\u0442\u043e\u043b\u044c \u043d\u0430\u0441\u044b\u0449\u0435\u043d\u043d\u043e\u0433\u043e \u0433\u0440\u0430\u0444\u0438\u043a\u0430 \u0442\u0443\u0440\u043d\u0438\u0440\u043e\u0432 \u0432 2021 \u0433\u043e\u0434\u0443 \u044f \u043f\u043e\u0447\u0443\u0432\u0441\u0442\u0432\u043e\u0432\u0430\u043b, \u0447\u0442\u043e \u044f \u043d\u0435 \u0433\u043e\u0442\u043e\u0432 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u0438 \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u0442\u044c \u043d\u0430 100%. \n\u042d\u0442\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0434\u0430\u043b\u043e\u0441\u044c \u043c\u043d\u0435 \u0442\u044f\u0436\u0435\u043b\u043e, \u043d\u043e \u043c\u043d\u0435 \u043f\u0440\u0438\u0448\u043b\u043e\u0441\u044c \u0435\u0433\u043e \u043f\u0440\u0438\u043d\u044f\u0442\u044c, \u0447\u0442\u043e\u0431\u044b \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0442\u044c \u0441\u0435\u0437\u043e\u043d \u0441 \u0445\u043e\u0440\u043e\u0448\u0438\u043c\u0438 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0430\u043c\u0438. \n\n\u0421\u043a\u043e\u0440\u043e \u0443\u0432\u0438\u0434\u0438\u043c\u0441\u044f!\n\nHello everyone! \n\nI am really sad to announce that this year I won\u2019t be participating in Kremlin cup.\nIt\u2019s always special to have a chance to play in front of Russian fans. \nI signed in to give myself best chances to play, but with calendar this year being extremely tough (addition of Indian Wells in October) I felt that my body is not ready 100% anymore. \nThis decision was very tough for me but it has to be done in order to be able to finish 2021 season strong! \n\nThank you and see all soon!"}}]},"edge_media_to_comment":{"count":741},"comments_disabled":false,"taken_at_timestamp":1634317028,"edge_liked_by":{"count":59402},"edge_media_preview_like":{"count":59402},"location":{"id":"228799211","has_public_page":true,"name":"Indian Wells, California","slug":"indian-wells-california"},"thumbnail_src":"https://instagram.fssz3-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/s640x640/245846202_341918017693248_1615170917102098168_n.jpg?_nc_ht=instagram.fssz3-1.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=bXibOaOxlLEAX8wcc-x\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=03f175802cf795f9f5389baf058455ee\u0026oe=61936C38\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.fssz3-1.fna.fbcdn.net/v/t51.2885-15/e35/s150x150/245846202_341918017693248_1615170917102098168_n.jpg?_nc_ht=instagram.fssz3-1.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=bXibOaOxlLEAX8wcc-x\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=fe9037c8dd55b01595bc7532282e07c2\u0026oe=61942033\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.fssz3-1.fna.fbcdn.net/v/t51.2885-15/e35/s240x240/245846202_341918017693248_1615170917102098168_n.jpg?_nc_ht=instagram.fssz
